import React, {useState, useEffect} from 'react';

import '../App.css';
import cmpositeSampleTypesAPI from "../api/cmpositeSampleTypesAPI";
import CompositeSampleType from "./_cmpositeSampleType";

const CompositeSampleTypePage = ({match}) => {
  // default members to empty array
  const cmpositeSampleTypeId = match.params.id
  const [cmpositeSampleType, setCompositeSampleType] = useState({});

  useEffect(() => {
    const init = async () => {
      // get members
      const response = await cmpositeSampleTypesAPI.getCompositeSampleType(cmpositeSampleTypeId);
      if (!response) return;

      // success
      setCompositeSampleType(response);
    };

    init();
  }, []);

  const editCompositeSampleType = () => {
    alert('TODO: Edit CompositeSampleType')
  }

  return (
    <>
      <div class='breadcrumbs'>
        <a href="/sample_types">CompositeSampleTypes</a>
        <span>></span>
        {cmpositeSampleType.name}
        <span>></span>
        <button onClick={() => editCompositeSampleType()}>Edit</button>
      </div>

      <div className="box width-box">
        <div className="flex box-title">
          <div className="flex-col-1">
            {cmpositeSampleType.name}
          </div>
        </div>
        <div className="plus-8"></div>

        <div className="flex box-row">
          <div className="flex-col-1">
            Name
          </div>
          <div className="flex-col-2">
            {cmpositeSampleType.name}
          </div>
        </div>

        <div className="flex box-row">
          <div className="flex-col-1">
            Description
          </div>
          <div className="flex-col-2">
            {cmpositeSampleType.description}
          </div>
        </div>

        <div className="plus-8"></div>
      </div>
    </>
  );
}

export default CompositeSampleTypePage;

